import React from 'react';
import './App.css';
import { Typography } from 'antd';
import { Card } from "antd";
import 'antd/dist/antd.css'; 

const { Title } = Typography;

function App() {
  return (
    <div>
      <Title>Steam Group Game Checker</Title>
      <Card title="Search for common games"  style={{ width: 300 }}>
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </div>
  );
}

export default App;
